import React from 'react';
import SocureComponent from './SocureComponent';

function App() {
  const inputData = {
    customerUserId: 'customIDFromTheCustomer',
  };

  const processConfig = {
    language: 'en',
    documentType: 'license',
  };

  const sdkKey = 'your-sdk-key';

  return (
    <div className="App">
      <SocureComponent
        step={1}
        inputData={inputData}
        processConfig={processConfig}
        sdkKey={sdkKey}
      />
    </div>
  );
}

export default App;
